Rules.InvariantScript:
With(
    {Text: Trim(txtInput_Lister.Text)},
    If(
        !IsBlank(Text),
        Collect(
            Items,
            {
                Id: GUID(),
                Value: Lister.ProcessUserInput(Text)
            }
        )
    )
);
Reset(txtInput_Lister)

Clear(Items);
ForAll(
    Lister.Items,
    Collect(
        Items,
        {
            Id: GUID(),
            Value: Value
        }
    )
)
